export function flattenJSON(jsonData) {
  const result = {};

  function recurse(curr, prop) {
    if (typeof curr !== "object" || curr === null) {
      result[prop] = curr;
    } else if (Array.isArray(curr)) {
      if (curr.length === 0) {
        result[prop] = [];
      } else {
        curr.forEach((item, index) => {
          recurse(item, `${prop}[${index}]`);
        });
      }
    } else {
      let isEmpty = true;
      for (const key in curr) {
        if (curr.hasOwnProperty(key)) {
          isEmpty = false;
          recurse(curr[key], prop ? `${prop}.${key}` : key);
        }
      }
      if (isEmpty && prop) {
        result[prop] = {};
      }
    }
  }

  recurse(jsonData, "");
  return result;
}
